import React from "react";
import { FaHome,FaPhoneAlt,FaMailBulk} from "react-icons/fa";


function Footer() {
  return (
    <React.Fragment>
        <div className="container">
            <div className="row">
                <div className="col-md-6">
<address><FaHome size={20} style={{color:'blue',marginRight:'2rem'}}/>West Melbourne,<br/>
        Florida.<br/>
        <FaPhoneAlt size={20} style={{color:'blue',marginRight:'2rem'}}/>321-405-4650<br/>
        <FaMailBulk size={20} style={{color:'blue',marginRight:'2rem',fontweight:'bold'}}/>vanim2@gmail.com
</address>
                </div>
                <div className="col-md-6">

                </div>
            </div>
        </div>
    </React.Fragment>
  )
}

export default Footer;
